import React, { Component } from "react";
import TextField from "@material-ui/core/TextField";
import Visibility from "@material-ui/icons/Visibility";
import VisibilityOff from "@material-ui/icons/VisibilityOff";
import InputAdornment from "@material-ui/core/InputAdornment";
import "./index.scss";

class Login extends Component {
  render() {
    return (
      <div className="login-container">
        <div className="login-static-data-section"></div>
        <div className="login-section">
          <div className="login-label">
            Login to <span className="space-os-label">Space OS</span>
          </div>
          <TextField
            id="standard-basic"
            className="user-name-text-field"
            label="Username"
            placeholder="enter your username"
            margin="normal"
          />
          <TextField
            type={this.state.showPassword ? "text" : "password"}
            label="Password"
            variant="outlined"
            margin="dense"
            fullWidth={true}
            name="password"
            className="margin-top-20"
            InputProps={{
              className: "padding-right-0",
              endAdornment: (
                <InputAdornment position="end">
                  <IconButton
                    edge="end"
                    aria-label="toggle password visibility"
                    onClick={e => this.handleClickShowPassword("loginPassword")}
                    onMouseDown={this.handleMouseDownPassword}
                  >
                    {this.state.showPassword ? (
                      <VisibilityOff />
                    ) : (
                      <Visibility />
                    )}
                  </IconButton>
                </InputAdornment>
              )
            }}
            required
            onChange={event =>
              this.setState({ loginPassword: event.target.value })
            }
          />
        </div>
      </div>
    );
  }
}

export default Login;
